d2-005056c00001'),(58,'Ирина','89121321451','voz',3.2,1,53,'Привет! Я - девушка, которая любит жизнь во всех её проявлениях! Я ценю комфорт и уверенность в завтрашнем дне, поэтому предпочитаю общество успешных и обеспеченных мужчин. Мой взгляд на отношения прост: взаимопонимание, взаимоподдержка и, конечно же, внимание к деталям.В ночном клубе я подрабатываю, создавая веселую атмосферу и получая удовольствие от общения. Я уверена, что жизнь должна быть насыщенной, и в этом мне помогает моя работа.\n\nЦенности для меня важны, и я ожидаю, что мой партнер будет разделять мою философию. Если ты готов подарить мне внимание, заботу и, конечно же, приятные сюрпризы, давай начнем наше увлекательное путешествие в мире взаимопонимания и удовольствия. Я жду встречи с интересным и обеспеченным мужчиной, который готов подарить мне частичку своего мира. Давай познакомимся и создадим что-то особенное! ','53162779-8642-11ee-84d2-005056c00001'),(59,'Полина','89121345647','voz',4.6,1,54,'Привет! Я - энергичная, миниатюрная блондинка с зелеными глазами, полна жизни и готова к новым приключениям! Моя страсть к фитнесу привела меня к победе в конкурсе фитнес бикини, и я горжусь своими достижениями.\nВстречаюсь в первую очередь для души, но и привыкла брать от жизни только лучшее поэтому пиши если тебе есть что предложить!','53162876-8642-11ee-84d2-005056c00001'),(60,'Юлия','89111134556','voz',4.2,1,55,'Харизматичная брюнетка, люблю клубы и тусовки, много путешествую. ','531629d9-8642-11ee-84d2-005056c00001'),(61,'Натали','89246789999','voz',3.2,1,56,'Люблю уверенных в себе мужчин, которые знают чего хотят от девушки и которым есть что предложить ей. Всегда готова к новым знакомствам. Пиши!','53162b2f-8642-11ee-84d2-005056c00001'),(62,'Катя','89123456777','voz',3.3,1,57,'Полность натуральная красотка с хорошей фигурой и приятной внешностью. Своя небольшая но красивая грудь. В поисках новых отношений. Пиши!','53162c25-8642-11ee-84d2-005056c00001'),(63,'Лена','89277563718','ego',3.9,1,58,'