 в компании обеспеченного мужчины','53198b6a-8642-11ee-84d2-005056c00001'),(259,'Кристина','89245567122','ufa',4.8,1,254,'Эскорт Дубай, Москваб, Екб! Всегда на связи, пишите!','53198e4d-8642-11ee-84d2-005056c00001'),(260,'Вика','89887872434','goj',5,1,255,'Фотомодель, с идеальной фигурой и очень яркой внешность. Очень развратна и ненасытна в постели, нравится пробовать что-то новенькое в сексе. Жду Ваших предложений господа!','531990b2-8642-11ee-84d2-005056c00001'),(261,'Лена','89298784545','goj',4.7,1,256,'Красивая, естественная, натуральная! Ищу богатого спонсора для постоянных встреч, рассмотрю любой регион РФ. Также работаю по Краснодару и Сочи','531994ec-8642-11ee-84d2-005056c00001'),(262,'Мария','89567712454','goj',5,1,257,'Высшее образование (тележурналист), также обучалась по специальности «Реклама и PR» и товароведение. Имею много профессиональных достижений. Я девушка с обложки Playboy Россия № 11 за 2020 год. В 2019 году обложки и интервью со мной публиковали такие известные журналы, как «Женское здоровье», «Silver», «Модный дом». Вошла в «Топ-40 самых красивых девушек» по версии журнала «Модный дом» 2018 года. Вице-мисс Рунета - 2018. Свою карьеру на телевидении я начала с работы корреспондентом, а затем вела телепрограмму о красоте на московском телеканале. Работала заместителем управляющего фитнес-клуба, а по сути — управляющей в течение полутора лет. Ныне я независимый эксперт в области красоты, бьютиблогер. Частая гостья телепрограмм в качестве эксперта. Являюсь лицом корейской клиники, также сотрудничаю с клиниками Израиля. Люблю готовить, не курю, выпиваю по праздникам. Добрая, заботливая, воспитанная и уравновешенная. Есть шенген, допускаю переезд. Ищу постоянные отношения, в перспективе замужество, с успешным и заботливым мужчиной.','531997d3-8642-11ee-84d2-005056c00001'),(263,'Камила','89678892131','goj',1.5,1,258,'Инди Уфа. Милый я вся горю пиши мне скорее!','53199d1e-8642-11ee-84d2-005056c00001'),(264,'Юля','89245567898','goj',3.7,1,259,'Очень апетитная девушка для любителей пышных форм!','5319a039-8642-11ee-84d2-005056c00001'),(265,'Милена','89111134556','goj',0,0,260,'','5319a1ef-8642-11ee-84d2-005056c00001'),(266,'Нина','89111134523','goj',3.7,1,261,'Милая и очень соблазнительная девушка приглашает тебя в гости с одной лишь целью, насладиться друг другом. Я очень люблю заниматься сексом, особенно когда рядом со мною будешь ты. Не сомневайся, я сделаю все для того, чтобы ты получил наслаждение и максим','5319a362-8642-11ee-84d2-005056c00001'),(267,'Лолита','89532213451','goj',2.7,1,262,'? С моим нежным прикосновением и страстным взглядом, я обрисую для тебя удивительное пространство, где каждая деталь наполнена тобой и нашей неиссякаемой страстью. Просто ? позвони мне, я буду тебя ждать. ??✨ В этом мире наше ? влечение будет ярче ка','5319a8bd-8642-11ee-84d2-005056c00001'),(268,'Света','89712234556','goj',2.2,1,263,'Сладкая кошечка ждет твоего звонка...','5319aad3-8642-11ee-84d2-005056c00001'),(269,'Марина','89677782121','goj',3.2,1,264,'Увлекаюсь психологией и очень люблю подарки. Дарю свою женскую энергетику и мотивирую мужчин на подвиги.','5319ad01-8642-11ee-84d2-005056c00001'),(270,'Полина ','89783342172','goj',0,0,265,'','5319b059-8642-11ee-84d2-005056c00001'),(271,'Ирина','89243321787','goj',3.9,1,266,'Знакомлюсь с успешными мужчинами. Океан нежности, душевные разговоры создадут приятную атмосферу нашему отдыху.','5319b27b-8642-11ee-84d2-005056c00001'),(272,'Рита','89782233122','goj',0,0,267,'','5319b468-8642-11ee-84d2-005056c00001'),(273,'Линда','89567789971','goj',0,0,268,'','5319b652-8642-11ee-84d2-005056c00001'),(274,'Вера','89786654321','goj',0,0,269,'','5319b82d-8642-11ee-84d2-005056c00001'),(275,'Инга','89234562211','rov',4.8,1,270,'Я очень миниатюрная и очень нежная и женственная брюнетка, в тоже время очень раскрепощённая и люблю пробовать всё новое. Когда пишите говорите конкретно, что Вам нужно и из кокого Вы города!','5319bbe1-8642-11ee-84d2-005056c00001'),(276,'Ангелина','89786652423