Queen 2019, Indiva Fashion Moscow, Miss International 2019, Miss Fitnes 2019. Снималась в клипах, в сериале с Гошей Куценко, напечатали в журнале Anturag. Сдала ГТО на золото, занимаюсь фитнесом. Раньше занималась танцами, верховой ездой, бильярдом, скалалазаньем. Закончила музыкальную школу по трем специальностям (фортепиано, флейта, орган), пою. Блогер, вела канал на youtube, сейчас веду инстаграм, занимаюсь обработкой фотографий. Умею вкусно готовить. К курению отношусь крайне негативно, очень редко могу позволить себе выпить. Есть загранпаспорт, немного владею английским и немецким языками, планирую получить права, в будущем допускаю переезд.','5319c6c6-8642-11ee-84d2-005056c00001'),(283,'Саша','89297712431','rov',0,0,278,'','5319c84a-8642-11ee-84d2-005056c00001'),(284,'Жасмин','89543322145','rov',0,0,279,'','5319c9a5-8642-11ee-84d2-005056c00001'),(285,'Линда ','89889721244','rov',0,0,280,'','5319cb94-8642-11ee-84d2-005056c00001'),(286,'Кристина','89248897123','rov',4.5,1,281,'Инди Москва. Я сделаю нашу встречу незабываемой. У меня красивая грудь, я оооочень люблю делать долгий, сочный минет. У меня совершенно нет комплексов и каких-либо табу, только шепни мне о своих желаниях и я исполню всё твои самые сокровенные фантазии) Жду звоночков)','5319ce39-8642-11ee-84d2-005056c00001'),(287,'Милена','897899999971','rov',4.1,1,282,'Я страстная и сексуальная девушка, готовая погрузиться с тобой в мир наслаждения и эротических фантазий. Со мной каждая минута будет наполнена страстью и удовольствием, я готова исполнить твои самые смелые желания.','5319cf9f-8642-11ee-84d2-005056c00001'),(288,'Ирина','89278897122','rov',3.6,1,283,'Строгая госпожа или ласковая кошочка, могу подстроится под лубого мужчину. Пиши всё обсудим! ','5319d0c5-8642-11ee-84d2-005056c00001'),(289,'Олеся','89213456677','rov',4.9,1,284,'Действующая фотомодель, очень спортивная девушка с идеальной фигурой и высшим образование, будет идеальным дополнением успешного мужчины','5319d1bf-8642-11ee-84d2-005056c00001'),(290,'Инга','89289712345','krr',4.9,1,285,'Сладкая, сексуально-романтичная молодая леди! Наполню тебя чувствами и энергией, подарю незабываемый отдых и оставлю незабываемое приятное впечатление!','5319d2b4-8642-11ee-84d2-005056c00001'),(291,'Кристина ','89881213371','krr',4.8,1,286,'Миниатюрная брюнетка, я просто создана воплощать ваши мечты. Очень нежная и общительная, всегда в хорошем настроении и с лёгкостью могу поднять его Вам. Пиши рассмотрю переезд в любой регион РФ!','5319d3a8-8642-11ee-84d2-005056c00001'),(292,'Катя','89679878897','krr',4.9,1,287,'Длинноногая брюнетка, с отличной фигурой и очень нежной кожей. Отлично танцую стриптиз и с удовольствием перевоплощаюсь в различные образы. На встречах всегда на высоких каблуках и в очень дорогом сексуальном белье. Нравится видеть когда мужчины восхищаются мной, и получать дорогие подарки!','5319d4ab-8642-11ee-84d2-005056c00001'),(293,'Света ','89288983122','krr',3.2,1,288,'Со мной ты забудешь обо всех своих проблемах, мои пальчики и горячий язычок приведут тебя в экстаз и восторг, поверь ты ещё долго будешь вспоминать наши проказы. Приглашаю к себе или с радостью приеду к тебе.','5319d5c6-8642-11ee-84d2-005056c00001'),(294,'Олеся','89389978871','krr',4.3,1,289,'Игривая и сладострастная! Умелая и хорошо чувствую мужчину, знойный темперамент, чуткая, нежная, люблю играть, флиртовать с мужчиной, дразнить и изводить его всячески доводя до пика эмоций.','5319d6bd-8642-11ee-84d2-005056c00001'),(295,'Женя','89678891231','krr',5,1,290,'Гражданка Украины, живу в Грузии, работаю в сфере красоты. Высшее образование (тележурналист, диктор и ведущий телепрограмм). Жила в Китае 3 года, работала моделью, занималась профессионально танцами, играла в театре. Занимаюсь спортом, веду здоровый образ жизни, не пью и не курю. Умею готовить. Владею русским, английским и китайским языками. Познакомлюсь с состоятельным мужчиной для отношений с содержанием, допускаю переезд.','5319d7af-8642-11ee-84d2-005056c00001'),(296,'Карина','89689972133','krr',5,1,291,'Блондинка с серо-голубыми глазами (натуральный цвет волос светло-русый). Родом из Мурманска, жила в Италии (был вид на жительство), сейчас живу в Сестрорецке (пригород СПБ). Высшее образование (преподаватель английского языка), владею также итальянским языком. Дополнительное профессиональное: фитнес-тренер международного класса и нутрициолог. Работаю тренером по фитнесу и нутрициологом. Участвую в соревнованиях по бодибилдингу и фитнесу, категория - фитнес-бикини, 5 место по Санкт-Петербургу (апрель 2022 года). Работала моделью в возрасте 19-20 лет. В свободное время занимаюсь йогой и люблю читать, увлекаюсь эзотерикой. Готовить умею, отдаю предпочтение ПП блюдам, но для мужчины могу приготовить все, что угодно, в том числе - итальянскую кухню (освоила во время проживания там). Не пью и не курю. Не вижу ничего страшного в бокале вина с любимым, за ужином. Разведена, сыну 5 лет (живет со мной). Вожу автомобиль, допускаю переезд в другие страны (Турция, Европа, ОАЭ), есть действующий шенген. Ищу постоянные, длительные отношения с порядочным и щедрым мужчиной старше 45 лет. Нужна стабильность: финансовая и сексуальная.','5319d8a6-8642-11ee-84d2-005056c00001'),(297,'Ольга','89387712425','krr',2.1,1,292,'Привет, мой сладкий! Я красивая, горячая девушка и у меня достаточно хороший сервис, чтобы вы могли расслабиться и повеселиться.','5319dcae-8642-11ee-84d2-005056c00001'),(298,'Анжела','89882123456','krr',5,1,293,'Родом из Перми. Модель, участница многих конкурсов красоты. Представляет Россию на конкурсе красоты Miss Cappadocia - 2022. Работаю в рекламном агентстве. Так же предоставляю эскорт услуги в России и Европе!','5319ddb6-8642-11ee-84d2-005056c00001'),(299,'Полина ','89881245465','krr',5,1,294,'Действующая модель, участвую в различных проектах. Путешествую. Встречаюсь и знакомлюсь в своё удовольствие.','5319deab-8642-11ee-84d2-005056c00001'),(300,'Кристина ','89287792432','krr',4.6,1,295,'Предоставляю эскорт услуги, Дубаи и Москва. ','5