меня есть множество фантазий, которые я бы хотела воплотить вместе с тобой. Мое тело является идеальным подарком, а я - привлекательный и увлекательный спутник, готовый превратить твои мечты в реальность.','5319fe12-8642-11ee-84d2-005056c00001'),(330,'Василиса','89883432145','gdz',5,1,324,'Изысканная элитная девушка эскорт с безупречными манерами, хорошим вкусом, высшим образованием станет украшением мужчины на любом светском торжестве. Предпочитают посещать частные вечеринки, дорогие рестораны, прогулки на яхтах отдыхать в пятизвездочных отелях. Роскошная девушка из высшего общества умеет поддержать интеллектуальную беседу, а также подарить наслаждение в интимной обстановке. Отдых с блистательной блондинкой с идеальной фигурой принесет вам массу удовольствия.','5319ff09-8642-11ee-84d2-005056c00001'),(331,'Елена','89883415676','gdz',0,0,325,'','5319fffe-8642-11ee-84d2-005056c00001'),(333,'Лера','89282311746','gdz',0,0,326,'','531a0114-8642-11ee-84d2-005056c00001'),(335,'Анжелика','89887764565','gdz',4.6,1,327,'Женственная и ласковая, общительная и гостеприимная, страстная и эмоциональная.??? На встречах я всегда красивая, ухоженная, полна жизненной и сексуальной энергии.','531a020b-8642-11ee-84d2-005056c00001'),(336,'Жанна','89578897898','gdz',3.9,1,328,'Если ты хочешь насладиться девушкой азиатской внешности ТОП-уровня не только на красивой картинке, но и в реальности – тебе точно ко мне. GFE – 100%! Лучшая для избранных! Я красива, как ангел, и сексуальна, как дьявол! Ухоженная до кончиков пальцев,..','531a0301-8642-11ee-84d2-005056c00001'),(337,'Лидия','89289712344','gdz',1.2,1,329,'Звони, хочу развлечься!','531a03f2-8642-11ee-84d2-005056c00001'),(339,'Лиза','89267789878','stw',4.8,1,330,'Работа: консьерж-агентство. Окончила педагогический колледж (учитель английского), университет физкультуры - менеджер в спорте. Владею английским, изучаю испанский, есть права. Визы шенген и Новая Зеландия. Хобби: тренаж зал, сквош, теннис, лыжи, путешествия. Интересуют знакомства для серьезных отношений, готова к перееду и рождению детей.','531a04ea-8642-11ee-84d2-005056c00001'),(340,'Полина ','89198875646','stw',4.7,1,331,'Если ты хочешь испытать весь спектр наслаждений, окунуться в океан, страсти и раскрепощенности, попробовать всё свои тайные желания и фантазии то я жду твоего звоночка! Со мной ты попробуешь всё и даже больше!','531a05dc-8642-11ee-84d2-005056c00001'),(341,'Карина','89297782131','stw',3,1,332,'Привет мой хороший! Я нежная девочка, умею доставить незабываемое удовольствие, люблю дарить наслаждение и получать его сама. Очень чувствительна в постели! Ты сможешь почувствовать себя самым счастливым и удовлетворенным мужчиной. Жду звонков!','531a06ce-8642-11ee-84d2-005056c00001'),(342,'Вера','89563214564','stw',3.8,1,333,'Модель, актриса. Высшее образование, владею английским и французским языками. В настоящее время работаю менеджером по персоналу. Красный диплом ветеринарного врача, содержку кошачий приют, дома три кошки. Целеустремленная, верная, заботливая. Занимаюсь конным спортом, катаюсь на велосипеде, роликах, коньках.','531a088e-8642-11ee-84d2-005056c00001'),(343,'Ника','89530003366','kgd',3.6,1,334,'Обожаю доставлять мужчинам нереальный кайф! Заряжаю энергией, отдаюсь вся без остатка. С удовольствием познакомлюсь и встречусь с интересными мужчинами) в интиме могу многое, только обсудить нужно заранее, что вы хотите) ','531a09d6-8642-11ee-84d2-005056c00001'),(344,'Яна','89678893142','gdz',3.5,1,335,'Я любвеобильная и чистоплотная в повседневной жизни девушка с шикарной задницей. Очень люблю секс, многое умею, буду ласковой с тобой в постели до последней твоей капли.','531a0ad4-8642-11ee-84d2-005056c00001'),(346,'Фаина','89091213456','stw',4.1,1,336,'Милая темнокожая красотка, составит компанию обеспеченному господину на вечер!','531a0bef-8642-11ee-84d2-005056c00001'),(347,'Тори','89196762134','stw',4.2,1,337,'Настоящий бриллиант, находка для эстетов, утонченная, ухоженная, стильная, знающая толк в идеальных отношениях без обязательств. Мне есть, чем поделиться. Каждая встреча неповторима! Все допы обсуждаю при встрече. Есть мини бар. Выезд только по Москве','531a0cec-8642-11ee-84d2-005056c00001'),(348,'Наргиза ','89684469663','mow',0,0,338,'','531a0de2-8642-11ee-84d2-005056c00001'),(349,'Катя','89092145678','stw',0,0,339,'','531a12ee-8642-11ee-84d2-005056c00001'),(350,'Лена','89197873213','stw',4.3,1,340,'Русская девушка эскорт, с тонкой талией и пышными округлостями, предлагает свои услуги уверенным в себе мужчинам, которые жаждут страстного общения. Вы проведете время безусловно в приятном обществе, так как я девушка образованная, могу красиво одеваться и обладаю мягким характером.','531a13e7-8642-11ee-84d2-005056c00001'),(351,'Анна','89389978456','stw',5,1,341,'Миниатюрная красотка с милым личиком и очень нежным характером познакомится с воспитанным мужчиной, ищу постоянные отношения с мат. поддержкой','531a14df-8642-11ee-84d2-005056c00001'),(352,'Линда','89375678897','stw',3.6,1,342,'Привет, мой сладкий! Я красивая, горячая девушка и у меня достаточно хороший сервис, чтобы вы могли расслабиться и повеселиться.','531a160a-8642-11ee-84d2-005056c00001'),(353,'Диана','89675437441','stw',4.1,1,343,'Воспитанная, милая девочка с нежнейшей кожей и с большой сексуальной энергетикой. Учусь в университете на экономиста и пишу картины.','531a1707-8642-11ee-84d2-005056c00001'),(354,'Марина','89183214556','stw',5,1,344,'Профессиональная эскортница, vip девочка, всегда на высоте и могу создать вокруг себя отличную обстановку. Люблю кожу и латекс, и очень развратна в постели!','531a17fe-8642-11ee-84d2-005056c00001'),(355,'Виолета','89174546676','stw',3.9,1,345,'Я обожаю вечерние романтические вечера, ужины при свечах и классическую музыку. Познакомлюсь с мужчиной для приятного времяпровождения.','531a18f2-8642-11ee-84d2-005056c00001'),(356,'Катя','89887875665','stw',3.2,1,346,'Нимфоманка и развратница, с радостью отдамся в хорошие руки!','531a19f3-8642-11ee-84d2-005056c00001'),(358,'Марго','89182142518','stw',1.7,1,347,'Сексуальная и ласковая кошечка, обаятельная и привлекательная, я удовлетворю любую твою просьбу. Приеду или приглашу в гости воспитанного мужчину для незабываемого отдыха!','531a1ae4-8642-11ee-84d2-005056c00001'),(359,'Милена','+79289975644','ptg',0,0,348,'','531a1bd6-8642-11ee-84d2-005056c00001'),(363,'Диана','89675567887','ptg',3.9,1,349,'Люблю роскош и дорогие падарки, пиши расмотрю все варианты!','531a1ccb-8642-11ee-84d2-005056c00001'),(364,'Лика','89851234565','ptg',3.4,1,350,'Игривая и сладострастная! Умелая и хорошо чувствую мужчину, знойный темперамент, чуткая, нежная, люблю играть, флиртовать с мужчиной, дразнить и изводить его всячески доводя до пика эмоций.','531a1dc0-8642-11ee-84d2-005056c00001'),(365,'Анфиса','89192311747','ptg',3.2,1,351,'Я очень милая и нежная, учусь в университете. Хочу дарить свою любовь успешному мужчине.','531a1eb3-8642-11ee-84d2-005056c00001'),(366,'Алина ','+79017958766','mow',2.2,1,352,'Стройная, очень ухоженная и эффектная красавица, откроет двери в мир, где исполняются даже самые грязные фантазии. Я тщательно слежу за собой, чтобы всегда восхищать и удивлять своих гостей.','531a1fd9-8642-11ee-84d2-005056c00001'),(367,'Сара','89192314565','ptg',0,0,353,'','531a20d4-8642-11ee-84d2-005056c00001'),(368,'Мария','89192314578','ptg',3.9,1,354,'Люблю романтический отдых, создам приятную, любовную атмосферу, чтобы ты расслабился и получил настоящее удовольствие со мной.','531a21c6-8642-11ee-84d2-005056c00001'),(370,'Кристина','89292314566','ptg',4.7,1,355,'Я та самая девочка с обложки playboy, предостовляю эскорт услуги во всех крупных городах РФ. Договариваюсь лично, на встречах в дорогом белье и высоких каблуках, есть много различных нарядов. Пиши всё обсудим!','531a22b6-8642-11ee-84d2-005056c00001'),(371,'Лилия','89652311747','ptg',0,0,356,'','531a23a9-8642-11ee-84d2-005056c00001'),(372,'Марина','89162341745','ksk',0,0,357,'','531a2515-8642-11ee-84d2-005056c00001'),(373,'Ира','89299811746','ptg',5,1,358,'Привет, я юная эскортица, работаю в Дубай и Москве также бываю во многих городах РФ. Если хочешь встречи со мной, то я всегда рада провести время в компании обеспеченного мужчины, готова воплотить самые смелые Ваши фантазии. Пиши со мной легко договориться, я очень милая и общительная!','531a2669-8642-11ee-84d2-005056c00001'),(374,'Тамара','89245567128','ptg',3.1,1,359,'Хочешь сочную попку или сладкие губки? Все это у меня! Специально для тех, кто любит себя и готов баловать изысканным отдыхом. Я стану твоей новой сексуальной фантазией! Моя гибкость, влажность и инициативность будут приводить тебя в восторг каждую секунд','531a27c9-8642-11ee-84d2-005056c00001'),(375,'Линда','89192314567','ptg',5,1,360,'Высшее образование, свободно владею английским, умею водить авто и мотоцикл. Мастер спорта по художественной гимнастике,сейчас профессионально танцую все виды танцев, делаю свой контент по растяжке, шпагату, хочу открыть свой студию воздушной гимнастки. Участвовала в конкурсах красоты, но не стала заниматься профессионально модельной деятельностью. Бегаю в лесу, прыгаю на лошадях, люблю готовить, вредных привычек нет. Ищу свою близкую душу, опору, плечо.','531a2920-8642-11ee-84d2-005056c00001'),(376,'Лена','89892314567','ptg',0,0,361,'','531a2a74-8642-11ee-84d2-005056c00001'),(377,'Вера','89789983121','vog',0,0,362,'','531a2bf0-8642-11ee-84d2-005056c00001'),(378,'Соня','89872311766','ptg',0,0,363,'','531a2d5e-8642-11ee-84d2-005056c00001'),(379,'Ольга','89872231445','ptg',3.2,1,364,'увственная, темпераментная красотка с восхитительными формами будет очень рада нашей встрече. Свидание со мной не оставит Вас равнодушным. Ласковый массаж поможет расслабиться, оральные ласки принесут бескрайнее удовольствие!','531a3092-8642-11ee-84d2-005056c00001'),(380,'Карина','89299987161','ptg',3.1,1,365,'Я немного испорченная девочка, властная, но в то же время и милая, я гарантирую вам лучшее качество и обещаю сделать нашу встречу незабываемой. Позвоните или напишите мне для получения дополнительной информации просто набери мой номер, малыш)','531a323c-8642-11ee-84d2-005056c00001'),(382,'Катя','89788897656','ksk',4.8,1,366,'Занимаюсь танцами на шесте, люблю эротику и все что с ней связано. Встречаюсь на высоких каблуках и в шикарных нарядах.','531a333f-8642-11ee-84d2-005056c00001'),(383,'Алёна','9873685354','rtw',0,0,367,'','531a3439-8642-11ee-84d2-005056c00001'),(384,'Полина ','89783456778','ksk',0,0,368,'','531a354a-8642-11ee-84d2-005056c00001'),(386,'Лина','9200601799','vog',0,0,369,'','531a363f-8642-11ee-84d2-005056c00001'),(388,'Мария','9261714771','vog',0,0,370,'','531a3772-8642-11ee-84d2-005056c00001');
